import './App.css';
import React from "react";
import Dictionary from "./Dictionary";

function App() {
  return (
    <div className="App">
      <header className="App-header">

       <button className="btn btn-primary w-80">
          Search
        </button>
        <Dictionary />
      </header>
    </div>
  );
}

export default App;
